import React from 'react'
import addButtonImg from '../images/add.png'


class AddButton extends React.Component{
    render(){
        return(
            <a href="/ExerciseNew">
                <img alt="add-button" className="mx-auto d-block" src={addButtonImg}></img>
            </a>
        )
    }
}

export default AddButton
